import React from "react";

function Bubble(props) {
  return (
    <div className="container">
      <h1>Yellow</h1>
      <div class="talk-bubble tri-right left-in">
        <div class="talktext">
          <p>
            This talk-bubble uses .left-in class to show a triangle on the left
            slightly indented. Still a blocky square.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Bubble;
